{
  "env": {
    "git-credential-helper": "yes"
  },
  "version": "0.2",
  "phases": {
    "install": {
      "runtime-versions": {
        "nodejs": 12
      },
      "commands": [
        "aws --profile damadden88 configure set aws_access_key_id $deployerAccessKeyId",
        "aws --profile damadden88 configure set aws_secret_access_key $deployerSecretAccessKey",
        "aws --profile default configure set region us-east-1",
        "npm install",
        "cd cdk && npm install && cd ..",
        "npm install -g aws-cdk@1.61.1"
      ]
    },
    "build": {
      "commands": [
        "npm run build",
        "ls -la",
        "echo \"run: $CDK_COMMAND\"",
        "eval $CDK_COMMAND"
      ]
    }
  },
  "artifacts": {
    "base-directory": "build",
    "files": [
      "**/*"
    ]
  }
}
